public class Solution {
    public int MinProcessingTime(IList<int> processorTime, IList<int> tasks) {
        int[] sortedProcessorTime = processorTime.ToArray();
        Array.Sort(sortedProcessorTime);
        int[] sortedTasks = tasks.ToArray();
        Array.Sort(sortedTasks);

        int n = sortedProcessorTime.Length;
        int maxTime = 0;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < 4; j++) {
                int taskIndex = i * 4 + j;
                sortedProcessorTime[i] += sortedTasks[taskIndex];
            }
            maxTime = Math.Max(maxTime, sortedProcessorTime[i]);
        }
        return maxTime;
    }
}
